/**
 * @param {string[]} words
 * @return {number[]}
 */
var lastVisitedIntegers = function(words) {
    let nums = []; // to store visited integers
    let result = []; // to store results for each "prev"
    let prevCount = 0; // to count consecutive "prev" strings

    for (let i = 0; i < words.length; i++) {
        if (words[i] === "prev") {
            prevCount++; // increase count for consecutive "prev"
            if (prevCount <= nums.length) {
                // If there are enough visited integers
                result.push(nums[nums.length - prevCount]); // Push the last visited integer
            } else {
                result.push(-1); // Not enough visited integers
            }
        } else {
            nums.push(parseInt(words[i], 10)); // Convert string to integer and push
            prevCount = 0; // Reset consecutive "prev" count
        }
    }

    return result;
};
